    rateCalc: function rateCalc(rate, curr) {
      if (curr == 'USD') {
        return '$' + parseFloat(rate).toFixed(2) + ' ' + curr;
      }if (curr == 'PTS') {
        return this.numberWithCommas(rate) + ' ' + curr;
      } else {
        return parseFloat(rate).toFixed(2) + ' ' + curr;
      }
    },

